import React, {useContext, useEffect} from 'react';
import {Context} from "../index";
import {getHeroes} from "../http/heroAPI";
import HeroCard from "../components/HeroCard";

const History = () => {
    const {hero} = useContext(Context)

    useEffect(() => {
        getHeroes(hero.page, 3).then(data => {
            hero.setHeroes(data.rows)
            hero.setTotalCount(data.count)
        })
    }, [hero.page])
    hero.heroes.map(hero => console.log(hero.name))
    return (
        <>
            {
                hero.heroes.map(hero =>
                    <HeroCard key={hero.id}/>
                )
            }
        </>
    );
};

export default History;
